/** * */public class Line {    public static String Tickets(int[] peopleInLine) {        int n25 = 0;        int n50 = 0;        for (int i : peopleInLine) {            System.out.println(i);            if (i == 25) {                n25 += 1;            }else if(i==50){                n25-=1;                n50+=1;            }else if(i==100 && n50>0){                n25-=1;                n50-=1;            }else if(i==100 && n50==0){                n25-=3;            }            if(n25<0 || n50<0){                return "NO";            }        }        return "YES";    }}